int trackMins = 0;
int trackHundredthSecond = 0;
unsigned long stopwatchStart = 0;
unsigned long stopwatchElapsed = 0;

unsigned long lastTimePressed = 0;
unsigned long debouncer = 50; 
unsigned long millisec = 1;

unsigned long lastResetPressed = 0;

bool firstCount = true;
bool count = false; // start the counting
bool isStart = true; // is the start button

bool lastRead = LOW;
bool lastResetRead = LOW;

bool dirtyMin, dirtySec, dirtyHun = true;

int lastMin = -1, lastSec = -1, lastHun = -1;

bool staticDrawn = false;

void updateStopWatch(){
    if(millis() - lastTimePressed >= debouncer){
      bool reading = digitalRead(BUTTON_START);

      if(reading != lastRead){
        lastTimePressed = millis();
        lastRead = reading;

        if (reading == !HIGH) {
            if(isStart){
                stopwatchStart = millis() - stopwatchElapsed;
                count = true;
                isStart = false;
            } else {
                count = false;
                isStart = true;
            }

      }
    }
    }

    if(millis() - lastResetPressed >= debouncer){
        bool reading = digitalRead(BUTTON_STOP);
        if(reading != lastResetRead){
            lastResetPressed = millis();
            lastResetRead = reading;
            if(reading == !HIGH) {
                if(isStart){
                    stopwatchElapsed = 0;
                } else {
                    count = false;
                    isStart = true;
                }
            }
        }
    }

    if(count) {
        stopwatchElapsed = millis() - stopwatchStart;
    }

    int mins = stopwatchElapsed/60000;
    int secs = (stopwatchElapsed / 1000);
    int hund = (stopwatchElapsed % 1000) /10;

    trackMins = mins;
    trackSeconds = secs;
    trackHundredthSecond = hund;

    if(mins!=lastMin) dirtyMin = true;
    if(secs!=lastSec) dirtySec = true;
    if(hund!=lastHun) dirtyHun = true;

    lastMin = mins;
    lastSec = secs;
    lastHun = hund;

}



